    const { catBreeds } = props;

    const catCardList = [];

    for (let index = 0; index < catBreeds.length; index++) {
      if (
        catBreeds[index].image !== undefined &&
        catBreeds[index].image.id !== undefined
      ) {
        catCardList.push(
          <CatCard
            key={catBreeds[index].image.id}
            cat={catBreeds[index]}
          ></CatCard>
        );
      }
    }
    console.log("", catCardList);
